import React from "react";
import { Link } from 'react-router-dom';
import { useState } from "react";

const SignUp = () => {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
      event.preventDefault();
      // Send email and password to server to authenticate
      console.log("Login form submitted!");
      console.log("Username: ", username);
      console.log("Password: ", password);
    };


    return (
        <>
        <div className="row align-items-center">
            <div className="col-md-6 col-sm-12">

              <div className="sign-up-form text-center">


                <form className="sign-up-form"><
                  h3 className="text-center">Sign up here</h3>
                  <div className="form-group my-2">
                    <label htmlFor="email">Email:</label>
                    <input type="email" className="form-control" id="email" placeholder="Enter your email" required/>
                  </div>
                  <div className="form-group my-2">
                    <label htmlFor="email">Username:</label>
                    <input type="username" className="form-control" id="username" placeholder="Enter your phone" required/>
                  </div>
                  <div className="form-group my-2">
                    <label htmlFor="email">Name:</label>
                    <input type="name" className="form-control" id="name" placeholder="Enter your name" required/>
                  </div>
                  <div className="form-group my-2">
                    <label htmlFor="email">Surname:</label>
                    <input type="surname" className="form-control" id="surname" placeholder="Enter your surname" required/>
                  </div>
                  <div className="form-group my-2">
                    <label htmlFor="email">Phone:</label>
                    <input type="phone" className="form-control" id="phone" placeholder="Enter your phone" required/>
                  </div>
                  <div className="form-group my-2">
                    <label htmlFor="email">Driver Licence:</label>
                    <input type="driverLicence" className="form-control" id="driverLicence" placeholder="Enter your licence" required/>
                  </div>
                  <div className="form-group my-2">
                    <label htmlFor="password">Password:</label>
                    <input type="password" className="form-control" id="password" placeholder="Enter your password" required/>
                  </div>
                  <button type="submit" className="log-in-button my-3">Sign up</button>

                </form>
              </div>
            </div>

            <div className="background-wrapper col-md-6 col-sm-12 display-flex" >
              <div className="d-flex flex-column align-items-center" >
                <h4 className="text-center my-4">Already have account?</h4>
                <p className="my-2">Log into system!</p>
                <Link to="/login" className="btn sign-up-button my-4">Log in</Link>
              </div>
            </div>
          </div>
        </>
    );
};

export default SignUp;
